import { MessageService } from '@/services/message.service';
import { ShelvesService } from "./shelves.service";
import tableMixin from '@/mixins/table.mixin';
import { columns } from "./shelves.config.ts";
import CardShopDepositShopTable from '@/views/biz-modals/card/shop-deposit/shop-table';
import { CONSUMPTION_RANGE } from '@/constants/card/deposit';
export default {
  mixins: [tableMixin],
  name: 'PageShopProductDepositShelves',
  bem: {
    shelves: 'page-shop-product-deposit-list-shelves'
  },
  modals: {
    CardShopDepositShopTable: CardShopDepositShopTable
  },
  serviceInject: function serviceInject() {
    return {
      messageService: MessageService,
      shelvesService: ShelvesService
    };
  },
  rxState: function rxState() {
    return {
      loading: this.shelvesService.loading$,
      publishChannel: this.shelvesService.publishChannel$,
      list: this.shelvesService.list$,
      page: this.shelvesService.page$
    };
  },
  data: function data() {
    return {
      CONSUMPTION_RANGE: CONSUMPTION_RANGE
    };
  },
  computed: {
    columns: columns
  },
  methods: {
    // 下架
    onShelfDown: function onShelfDown(record) {
      var _this = this;

      this.$confirm({
        title: "\u4E0B\u67B6".concat(this.$c('member_card')),
        content: "\u786E\u5B9A\u4E0B\u67B6".concat(record.card_name, "\u50A8\u503C\u5361\u5417\uFF1F"),
        onOk: function onOk() {
          return _this.shelvesService.setCardShelfDown(record.id).toPromise().then(function () {
            _this.messageService.success({
              content: '下架成功'
            });

            _this.$router.reload();
          });
        }
      });
    }
  }
};
